// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

/// @title ProductRegistry - Gestión de productos en la cadena de suministro.
contract ProductRegistry {
    // Estructura de un producto
    struct Product {
        uint256 id;
        string name;
        string description;
        string origin;
        address currentOwner;
        uint256 creationTimestamp; 
    }

    // Mapeo para almacenar los productos por su ID único
    mapping(uint256 => Product) private products;

    // Lista de IDs de productos (opcional para facilidad de consulta)
    uint256[] private productIds;

    // Evento para notificar la creación de un nuevo producto
    event ProductCreated(
        uint256 indexed productId,
        string name,
        string description,
        string origin,
        address indexed owner,
        uint256 timestamp
    );

    // Contador para generar IDs únicos
    uint256 private nextProductId = 1;

    // Modificador para verificar que un producto no exista ya
    modifier productDoesNotExist(uint256 productId) {
        require(products[productId].id == 0, "Product already exists");
        _;
    }

    // Función para crear un nuevo producto
    function createProduct(
        string calldata name,
        string calldata description,
        string calldata origin
    ) external productDoesNotExist(nextProductId) {
        require(bytes(name).length > 0, "Product name cannot be empty");
        require(bytes(origin).length > 0, "Origin cannot be empty");

        // Crear un nuevo producto
        Product memory newProduct = Product({
            id: nextProductId,
            name: name,
            description: description,
            origin: origin,
            currentOwner: msg.sender,
            creationTimestamp: block.timestamp
        });

        // Almacenar el producto en el mapeo
        products[nextProductId] = newProduct;

        // Registrar el ID en la lista
        productIds.push(nextProductId);

        // Emitir un evento de creación
        emit ProductCreated(
            nextProductId,
            name,
            description,
            origin,
            msg.sender,
            block.timestamp
        );

        // Incrementar el contador de IDs
        nextProductId++;
    }

    // Función para obtener los detalles de un producto por ID
    function getProduct(uint256 productId)
        external
        view
        returns (
            uint256 id,
            string memory name,
            string memory description,
            string memory origin,
            address currentOwner,
            uint256 creationTimestamp
        )
    {
        require(products[productId].id != 0, "Product does not exist");

        Product memory product = products[productId];
        return (
            product.id,
            product.name,
            product.description,
            product.origin,
            product.currentOwner,
            product.creationTimestamp
        );
    }

    // Función para obtener todos los IDs de productos
    function getAllProductIds() external view returns (uint256[] memory) {
        return productIds;
    }
}
